import React from "react";

function FetchPage(){
    console.log("호출되니?")
    const config = {
        method: "get"
      };
    fetch("https://jsonplaceholder.typicode.com/users/1", config)
    .then(response => response.json())
    .then(data => {
      const name123 = document.createElement("div");
      const email123 = document.createElement("div");
      const phone123 = document.createElement("div");
      name123.textContent = data.name;
      email123.textContent = data.email;
      phone123.textContent = data.phone;
      const userInfo = document.getElementById("userInfo");
      userInfo.appendChild(name123);
      userInfo.appendChild(email123);
      userInfo.appendChild(phone123);
    })
    .catch(error => console.log("fetch 에러!"));
};

export default FetchPage
